import React from 'react';
import './Button.css';

const NumberButton = props => {
  const numbers = [9, 8, 7, 6, 5, 4, 3, 2, 1, 0];
  return (
    <div>
      {props.numbers}
      {numbers.map(numberFromMap => (
        <NumberButton number={numberFromMap} key={numberFromMap.numbers} />
      ))}
    </div>
  );
};

export default NumberButton;
